/* Creates table acc2k which stores data of a sample of 2000 traffic accidents */
DROP TABLE IF EXISTS acc2k;

SET datestyle = "ISO, DMY";

CREATE TABLE acc2k(
	accident_Index text primary key,
	location_easting_OSGR int,
	location_northing_OSGR int,
	longitude real,
	latitude real,
	police_force text,
	accident_severity int,
	number_of_vehicles int,
	number_of_casualties int,
	accdate date,
	day_of_week int,
	acctime time,
	local_authority_district int,
	local_authority_highway text,
	first_road_class int,
	first_road_number int,
	road_type int,
	speed_limit int,
	junction_detail int,
	junction_control int,
	second_road_class int,
	second_road_number int,
	pedestrian_crossing_human_control int,
	pedestrian_crossing_physical_facilities int,
	light_conditions int,
	weather_conditions int,
	road_surface_conditions int,
	special_conditions_at_site int,
	carriageway_hazards int,
	urban_or_rural_area int,
	did_police_officer_attend_scene_of_accident int,
	lsoa_of_accident_location text
);
COPY acc2k FROM STDIN (FORMAT CSV);
